import React from "react";
import "./navigation.css";

class Addpost extends React.Component {
  render() {
    return (
      <div className="nav">
        <form>
          <label>Title : </label>
          <input type="text" />
          <label>Category : </label>
          <input type="text" />
          <label>Write New Post : </label>
        </form>
      </div>
    );
  }
}

export default Addpost;
